      ServiceType = transferObject.ServiceType[n];
      partsReplaced = transferObject.partsReplaced[n];
      cost = transferObject.cost[n];
      isUnderInsurance = transferObject.isUnderInsurance[n];
      Message = transferObject.Message[n];
      num = n;
    
}

